[AD] Swedish summers are all about being outdoors and simply enjoy the nice weather. Here we are at the royal island of Djurgården, a lush oasis in Stockholm. 
And what better way to enjoy the nice weather than having a fika/picnic with some prosecco, mozzarella, and bruschettas! 
@Martini #MartiniPartner #ad

Bali or Philippines or Costa Rica? 
@christineabroad and I are thinking about doing a tropial getaway for 1 month later this year. 
What destination would you pick, and why? 😀

Karlovy Vary, Czech Republic 🇨🇿 A historical Spa Town in the western part of the country. What makes it more special is the facit that there are several hot springs in the city, with mineral water good for health and wellness. 
In addition to that it’s also a beautiful town :) fun fact: In Karlovy Vary, you can also go to a Beer spa and bathe in beer! 🍺
@visitczechrepublic_dk #czechrepublic #karlovyvary
